import axios from "axios";

// const apiCep = axios.create({
//   baseURL: "https://viacep.com.br/ws/"
// });

const apiCep = axios.get('https://viacep.com.br/ws/')
.then(response => {
  console.log(response.data.created_at);
});

export default apiCep;
